Solves #309

Adds a `Console` class plus `ConsoleDriver` to power input and output from the console.

Additionally adds extensions to `Command` that allow it to use the console.

Example:

``` swift
class Greeting: Command {
    let id: String
    let app: Application

    let arguments = [
        Argument("name")
    ]

    let options = [
        Option("emphatic")
    ]

    init(app: Application) {
        id = "hello"
        self.app = app
    }

    func run() throws {
        guard let name = try argument("name").string else {
            throw CommandError.custom("Name was not a string")
        }

        var message = "Hello, \(name)"

        if option("emphatic").bool == true {
            message += "!"
        }

        info(message)

        while confirm("Shall I say it again?") {
            info(message)
        }
    }
}
```
